  full_desc: 'Naruto Uzumaki (うずまき ナルト)\n' +
    'Age: 12-13 (Naruto part I), 15-17 (part II), 19 (The Last: Naruto the Movie), 27 (Naruto epilogue), 32 (Boruto: Naruto the Movie)\r\n' +
    'Birthday: October 10\r\n' +
    'Blood type: B\r\n' +
    'Height: 145–147 cm (I), 166 cm (II), 174 cm (The Last: Naruto the Movie), 180 cm (Boruto: Naruto the Movie)\r\n' +
    'Weight: 41–44 kg (I), 52 kg (II), 56 kg (The Last: Naruto the Movie), 66 kg (Boruto: Naruto the Movie)\r\n' +
    'Favorite food: Ichiraku ramen\r\n' +
    '\r\n' +
    "Born in Konohagakure, a ninja village hidden in the leaves, Naruto Uzumaki was destined for greatness. When born, a powerful nine-tailed demon fox attacked his village. With a wave of its tail, the demon fox could raise tsunamis and shatter mountains. In a valiant attempt to save the village from destruction, the Fourth Hokage, the leader of the Hidden Leaf Village, sealed the demon fox within Naruto's newborn body. This was his final act, for the battle with the fox cost him his life.\r\n" +
    '\r\n' +
    "Despite the Fourth Hokage's dying wish that Naruto be viewed as a hero for serving as the container for the demon (a Jinchuuriki) the adult villagers of Konoha harbored a fierce hatred for him, with many believing that Naruto and the demon were one and the same. Cast aside as an inhuman monster, Naruto was outcast and ostracized by the villagers for reasons he could not understand. The children his age could only ever follow their parents' example; and they too came to harbor a fierce hatred for Naruto.\r\n" +
    '\r\n' +
    'Naruto eventually came to accept that he would live and die alone, and his external response was to perform harmless pranks on the village. Coy, raffish and full of life, Naruto soon came to display a somewhat unexpected determination to succeed and be accepted by others. Upon being assigned to "Team Seven" as a Genin-ranked ninja, his true potential soon became outwardly apparent.\r\n' +
    '\r\n' +
    'Vowing to become Hokage one day and using his will to never give in, Naruto saves the village from invading forces and earns his acceptance. Eventually, Naruto learns to harness the power of the Demon Fox sealed inside him to perform acts of strength far beyond what any other human is capable of.\r\n' +
    '\r\n' +
    'In all, Naruto is an admirable character whose sheer determination to succeed despite the odds, earns him respect and devotion from his fellow villagers.\r\n' +
    '\r\n' +
    'He becomes the hero of his village, after defeating the six Pains all by himself.\r\n' +
    'He then befriends the nine-tails inside of him and control its powers. In time, he also becomes more dependable considering the Shinobi Alliance completely relies and respects his power, even the reanimated previous Hokages.\r\n' +
    'He later receives chakra from all the nine tailed beasts and then gains the power of the sage of the six paths, along with Sasuke.\r\n' +
    'At the end of the manga, he is married to Hinata with two children, Boruto and Himawari, and becomes the seventh hokage.',
